import React, { useEffect, useMemo, useState } from 'react'
import axios from 'axios'
import { AgGridReact } from 'ag-grid-react'
import 'ag-grid-community/styles/ag-grid.css'
import 'ag-grid-community/styles/ag-theme-quartz.css'
import '../AppGrid.css';
import { Form, Button } from 'react-bootstrap';
import { useSkuForm } from './CskuForm'
import { SearchBar } from './SearchBar';

/* tudus
set new row at the top
get product tags
if product tag exist, with vendor id or not, ask first, then action
*/


const GridPackaging = () => {
    const { vendorData, productTag } = useSkuForm();
    const [rowData, setRowData] = useState([])
    const [rowData2, setRowData2] = useState([])
    const [colData, setColData] = useState(
        [
            { headerName: 'Vendor ID', field: 'vendor_id', width: 150 },
            {
                headerName: 'Product Tag', field: 'product_tag', width: 150
            },
            { headerName: 'Cost of Packaging Fee', field: 'cost_of_packaging', editable: true, width: 200 },
        ]
    )
    const [colData2, setColData2] = useState(
        [
            { headerName: 'Product Tag', field: 'product_tag', width: 150 },
            { headerName: 'Cost of Packaging Fee', field: 'cost_of_packaging', editable: true, width: 200 },
        ]
    )

    window.v = vendorData;
    window.pt = productTag

    const [vendorId, setVendorId] = React.useState('');
    const [productTagValue, setProductTagValue] = React.useState('');
    const [costOfPackaging, setCostOfPackaging] = React.useState('');

    useEffect(() => {
        const fetchPVendor = async () => {
            try {
                const response = await axios.get(`http://localhost:8000/packagingvendor`)
                setRowData(response.data)
            }
            catch (error) {
                console.log('fetchPVendor threw an error, ', error);
            }
        }
        const fetchPWarehouse = async () => {
            try {
                const response = await axios.get(`http://localhost:8000/packagingwarehouse`)
                setRowData2(response.data)
            }
            catch (error) {
                console.log('fetchPWarehouse threw an error, ', error);
            }
        }
        fetchPVendor()
        fetchPWarehouse()
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('submitting')
    }


    return (
        <div className='mt-3 d-flex' style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
            <div className="ag-theme-quartz-dark" style={{ height: 800, width: 600, textAlign: 'left' }}>
                <h3>Vendor's Packaging Fees</h3>
                <AgGridReact
                    columnDefs={colData}
                    defaultColDef={{ flex: 1 }}
                    rowData={rowData}
                >
                </AgGridReact>
                <div style={{ width: '100%', height: '4em', border: '1px black solid', marginTop: '1em' }}>
                    <Form onSubmit={handleSubmit}>
                        <Form.Group controlId="vendorId">
                            <Form.Label>Vendor ID</Form.Label>
                            <Form.Control as="select" value={vendorId} onChange={e => setVendorId(e.target.value)}>
                                {vendorData.map((vendor, index) => (
                                    <option key={index} value={vendor}>{vendor}</option>
                                ))}
                            </Form.Control>
                        </Form.Group>

                        <Form.Group controlId="productTag">
                            <Form.Label>Product Tag</Form.Label>
                            <Form.Control as="select" value={productTagValue} onChange={e => setProductTagValue(e.target.value)}>
                                {productTag.map((tag, index) => (
                                    <option key={index} value={tag}>{tag}</option>
                                ))}
                            </Form.Control>
                        </Form.Group>

                        <Form.Group controlId="costOfPackaging">
                            <Form.Label>Cost of Packaging Fee</Form.Label>
                            <Form.Control type="number" value={costOfPackaging} onChange={e => setCostOfPackaging(e.target.value)} />
                        </Form.Group>

                        <Button variant="primary" type="submit">
                            Submit
                        </Button>
                    </Form>
                </div>
            </div>

            <div className="ag-theme-quartz-dark" style={{ height: 800, width: 400, textAlign: 'left' }}>
                <h3>Generic Packaging Fees</h3>
                <AgGridReact
                    columnDefs={colData2}
                    defaultColDef={{ flex: 1 }}
                    rowData={rowData2}>
                </AgGridReact>
            </div>
        </div>
    )

}

export default GridPackaging;
